import { BrowserRouter, Route, Routes, } from "react-router-dom";
import React, { useState } from 'react';

import { lazy } from "react";
import { Suspense } from "react";
import Spinner from "./../Layout/Spinner";
import { Navigate } from "react-router-dom";
import FlightTracker from "../components/FlightTracker";
import Auth from "../components/Auth";
import Admindash from "../components/Admindash";
import "bootstrap/dist/css/bootstrap.min.css"
import usersData from '../components/users.json';
import SignUp from "../components/SignUp";
const Home = lazy(() => import("../pages/Home"));
const BrowsePage = lazy(() => import("../pages/BrowsePage"));

const RoutePaths = () => {
  const [loggedInUser, setLoggedInUser] = useState(null);

  const handleLogout = () => {
    setLoggedInUser(null);
  };

  const PrivateRoute = ({ component: Component, ...rest }) => (
    <Route
      {...rest}
      render={(props) =>
        loggedInUser ? (
          <Component {...props} loggedInUser={loggedInUser} handleLogout={handleLogout} />
        ) : (
          <Navigate to="/auth" />
        )
      }
    />
  );

  return (
    <BrowserRouter>
      <Suspense fallback={<Spinner />}>
        <Routes>

          <Route path="/" element={<Navigate to="/FlyM/" />}></Route>
          <PrivateRoute path="/FlyM/" element={<Home />}></PrivateRoute>
          <Route path="/FlyM/browse-page" element={<BrowsePage />}></Route>
          <Route path="/page" element={<FlightTracker />}></Route>
          <Route path="/flight" element={<Admindash />}></Route>
          <Route path="/">
          <Navigate to="/auth" />
        </Route>
        <Route path="/auth" element={<Auth setLoggedInUser={setLoggedInUser} />} />
        <Route path="/create-account">
          <SignUp />
        </Route>

        </Routes>
      </Suspense>
    </BrowserRouter>
  );
};

export default RoutePaths;
